function App() {
    const [msg, setMsg] = useState("")
    const clk = () => {
        console.log(msg)
    }
    const chg = (event) => {
        console.log(event.target.value)
    }
    return (
        <div>
            <Button size={"lg"} onClick={clk} variant={"primary"}> Login</Button>
            <FloatingLabel
                controlId="floatingInput"
                label="Email address"
                className="mb-3"
            >
                <Form.Control type="email" placeholder="name@example.com" onChange={chg} id={"email"}/>
            </FloatingLabel>
            <FloatingLabel controlId="floatingPassword" label="Password">
                <Form.Control type="password" placeholder="Password"/>
            </FloatingLabel>
        </div>
    );
}

export default App;
